    "passiveSkill": [
      {
        "name": "Suppressive Barrage",
        "image": "https://gi.yatta.moe/assets/UI/UI_Talent_S_Mika_05.png?vh=2024082600",
        "description": "Per the following circumstances, the Soulwind state caused by Starfrost Swirl will grant characters the Detector effect, increasing their Physical DMG by 10% when they are on the field.\n·If the Flowfrost Arrow hits more than one opponent, each additional opponent hit will generate 1 Detector stack.\n·When a Rimestar Shard hits an opponent, it will generate 1 Detector stack. Each Rimestar Shard can trigger the effect 1 time.\n\nThe Soulwind state can have a maximum of 3 Detector stacks, and if Starfrost Swirl is cast again during this duration, the pre-existing Soulwind state and all its Detector stacks will be cleared."
      },
      {
        "name": "Topographical Mapping",
        "image": "https://gi.yatta.moe/assets/UI/UI_Talent_S_Mika_06.png?vh=2024082600",
        "description": "When an active character affected by both Skyfeather Song's Eagleplume and Starfrost Swirl's Soulwind at once scores a CRIT Hit with their attacks, Soulwind will grant them 1 stack of Detector from Suppressive Barrage. During a single instance of Soulwind, 1 Detector stack can be gained in this manner.\nAdditionally, the maximum number of stacks that can be gained through Soulwind alone is increased by 1.\nRequires Suppressive Barrage to be unlocked first."
      },
      {
        "name": "Demarcation",
        "image": "https://gi.yatta.moe/assets/UI/UI_Talent_Collect_Local_Mengde.png?vh=2024082600",
        "description": "Displays the location of nearby resources unique to Mondstadt on the mini-map."
      }
    ],
