    "passiveSkill": [
      {
        "name": "Agony Alone May Be Repaid",
        "image": "https://gi.yatta.moe/assets/UI/UI_Talent_S_Arlecchino_05.png?vh=2024082600",
        "description": "Blood-Debt Directives have the following characteristics:\n·Arlecchino will be granted a Bond of Life worth 130% of her Max HP when an opponent to which she herself applied a Directive is defeated.\n·5s after a Directive is applied, it will be upgraded to a Blood-Debt Due. When absorbed, it will instead grant Arlecchino a Bond of Life worth 130%.\nA Bond of Life created in the aforementioned ways cannot exceed the original limit on the value of Bonds of Life obtained through All Is Ash."
      },
      {
        "name": "Strength Alone Can Defend",
        "image": "https://gi.yatta.moe/assets/UI/UI_Talent_S_Arlecchino_06.png?vh=2024082600",
        "description": "Arlecchino gains 1% All Elemental and Physical RES for every 100 ATK she has in excess of 1,000. The maximum RES increase she can gain this way for each is 20%."
      },
      {
        "name": "The Balemoon Alone May Know",
        "image": "https://gi.yatta.moe/assets/UI/UI_Talent_S_Arlecchino_07.png?vh=2024082600",
        "description": "While in combat, Arlecchino gains a 40% Pyro DMG Bonus and can only be healed through Balemoon Rising."
      }
    ],
    "constellation": [
      {
        "name": "1. \"All Reprisals and Arrears, Mine to Bear...\"",
        "image": "https://gi.yatta.moe/assets/UI/UI_Talent_S_Arlecchino_01.png?vh=2024082600",
        "description": "Masque of the Red Death is further enhanced, the value of the increase is 100%. Additionally, Arlecchino's interruption resistance is increased when she performs Normal or Charged Attacks while affected by the Masque of the Red Death."
      },
      {
        "name": "2. \"All Rewards and Retribution, Mine to Bestow...\"",
        "image": "https://gi.yatta.moe/assets/UI/UI_Talent_S_Arlecchino_02.png?vh=2024082600",
        "description": "Blood-Debt Directives are now already Blood-Debt Due when first applied.\nWhen Arlecchino absorbs such a Due, she unleashes Balemoon Bloodfire in front of her, dealing 900% of her ATK as AoE Pyro DMG and increasing her All Elemental RES and Physical RES by 20% for 15s. This effect can trigger once every 10s.\nYou must first unlock the Passive Talent \"Agony Alone May Be Repaid.\""
      },
      {
        "name": "3. \"You Shall Become a New Member of Our Family...\"",
        "image": "https://gi.yatta.moe/assets/UI/UI_Talent_U_Arlecchino_01.png?vh=2024082600",
        "description": "Increases the Level of Normal Attack: Invitation to a Beheading by 3.\nMaximum upgrade level is 15."
      },
      {
        "name": "4. \"You Shall Love and Protect Each Other Henceforth...\"",
        "image": "https://gi.yatta.moe/assets/UI/UI_Talent_S_Arlecchino_03.png?vh=2024082600",
        "description": "When Arlecchino successfully absorbs a Blood-Debt Directive, Balemoon Rising's CD will decrease by 2s and 15 Elemental Energy will be restored to her. This effect can occur once every 10s."
      },
      {
        "name": "5. \"For Alone, We Are as Good as Dead...\"",
        "image": "https://gi.yatta.moe/assets/UI/UI_Talent_U_Arlecchino_02.png?vh=2024082600",
        "description": "Increases the Level of Balemoon Rising by 3.\nMaximum upgrade level is 15."
      },
      {
        "name": "6. \"From This Day On, We Shall Delight in New Life Together.\"",
        "image": "https://gi.yatta.moe/assets/UI/UI_Talent_S_Arlecchino_04.png?vh=2024082600",
        "description": "The DMG of Balemoon Rising is increased by Arlecchino's ATK multiplied by 700% of Arlecchino's current Bond of Life percentage.\nFor 20s after Arlecchino uses All Is Ash, both her Normal Attacks and Elemental Burst gain 10% increased CRIT Rate and 70% increased CRIT DMG. This effect can be triggered up to once every 15s."
      }
    ],
